import gql from 'graphql-tag';

const USERS_ITEMS_QUERY = gql`
  query USERS_ITEMS_QUERY {
    currentUser {
    itemsByOwnerId {
      nodes {
        product
        quantity
        status
      }
    }
  }
`;

export { USERS_ITEMS_QUERY };
